@Component({
    selector: "app-auth",
    templateUrl: './auth.component.html',
    styleUrls: ['auth.component.scss'],
    standalone: true,
    imports: [RegisterComponent, LoginComponent, ForgotPasswordComponent, ResetPasswordComponent],
})

